import React from 'react';
import FarabiPics from ".././Farabi/billalpro_auto_x2.jpg";

const FarabiPic = () => {
    const picStyle ={
        width:'30%',
        
        justifyContent: "center",
    
    };
    return (
        <div>
            <h1>I am Billal Farabi</h1>
            <img style={picStyle} src={FarabiPics}></img>
        </div>
    );
};

export default FarabiPic;
